import React from "react";
import { Parallax } from "react-scroll-parallax";

export default function UpcomingTreks(){
    return <div>
        <Parallax
            opacity={[]}
        >
            <div className="h-[50px] w-[200px] m-auto text-gray-50 font-Quicksand tracking-[2px] border-2 border-gray-50 bg-black"> 
                <div className="ml-4 mt-3">UPCOMING TREKS</div>
            </div>
        </Parallax>
    </div>
}
